  asm volatile("" : "+m" (state__));
  asm volatile("" : "+m" (key__));
  asm volatile("" : "+m" (tweak__));

  /* Outputs */
  DATATYPE cipher__[4];
  /* Primitive call */
  clyde128__(state__, key__, tweak__,cipher__);

  /* Preventing outputs from being optimized out */
  asm volatile("" : "+m" (cipher__));

